  'E-Mail Benachrichtigung' => 'E-Mail notification',
  'Gemeinschaft bietet die M&ouml;glichkeit, Tasten an unterst&uuml;tzten Endgeräten &uuml;ber diese Benutzeroberfl&auml;che zu konfigurieren.' => 'Gemeinschaft allows you to configure keys on supported telephony devices via this user interface.',
  'Um Tasten f&uuml;r Ihr Endger&auml;t zu konfigurieren, folgen Sie einfach den folgenden Schritten, nachdem Sie links im Men&uuml; auf Tastenbelegung geklickt haben:' => 'To configure keys for your terminal, simply follow these steps after you clicked on the key configuration menu item in the menu on the left:',
  'Schritt 1:' => 'Step 1:',
  'W&auml;hlen Sie Ihr Telefonmodell aus (1) und dr&uuml;cken Sie auf \'Zeigen\' (2)' => 'Choose your terminal type from (1) and click on \'Show\' (2)',
  'Schritt 2:' => 'Step 2:',
  'Dannach sehen Sie die folgende &Uuml;bersicht (oder &auml;hnlich):' => 'After that you see the following overview (or similar):',
  'Die Bedeutung der einzelnen Spalten:' => 'Meaning of the columns:',
  'Taste' => 'Key',
  'Beschreibt die Taste am Telefon, im Beispiel ist F001 die oberste Taste am Display vom Siemens Openstage 60.' => 'Describes the key on the telephone, in the example F001 is the top key on the display of a Siemens Openstage 60.',
  'Zeigt an, ob die Taste aktiviert ist oder nicht, Sie k&ouml;nnen die Taste nur definieren, wenn Sie diese vorher mit dem Haken in dieser Box aktivieren. Wenn die Taste vom Administrator vorgegeben ist, wird die Box f&uuml;r den Haken ausgegraut angezeigt. Sie können die Taste nicht bearbeiten.' => 'Shows wether the key is activated. You can only define the key if you activated it using this checkbox. If the key has been predefined by the administrator, the checkbox will be greyed out. You cannot edit the key then.',
  'Nummer/Daten' => 'Number/data',
  'In dieses Feld werden funktionsspezifische Daten eingetragen, z.B. die Zielnummer bei einer Zielwahl. Mehr dazu erfahren Sie im n&auml;chsten Schritt.' => 'This field gets function specific data, e.g. the destination number on direct dial keys. You get more information on this in the next step.',
  'Beschriftung' => 'Label',
  'Hier muss der Text eingegeben werden, wie er am Telefon neben der Taste erscheinen soll.' => 'Here you must enter the text which is to be displayed next to the key onthe phone.',
  'Gesch&uuml;tzt?' => 'Locked?',
  'Wenn in dieser Spalte ein kleines Schloss angezeigt wird (im Beispiel in den letzten beiden Zeilen), dann ist diese Taste vom Administrator gegen eine Bearbeitung gesch&uuml;tzt. Sie k&ouml;nnen diese Taste nicht konfigurieren.' => 'If a lock is displayed in this column (the last two rows in the example), the key has been locked for editing by the administrator. You cannot configure this key.',
  'Schritt 3:' => 'Step 3:',
  'Aktivieren Sie die Taste durch Anklicken des Hakens in der 2. Spalte (1)' => 'Activate the key by clicking the checkbox in the second column (1)',
  'W&auml;hlen Sie aus der Liste (2) die gew&uuml;nschte Tastenfunktion (3) aus:' => 'Choose the desired key function (3) from the list (2):',
  'Die Tastenfunktionen sind stark vom benutzten Endger&auml;t abh&auml;ngig. Hier eine Liste f&uuml;r das Openstage 60, welches die Tastenfunktionen der meisten Telefone abdecken sollte:' => 'The available key function are dependend of the used terminal. Here is a list for the Openstage 60, which matches the key functions of the most supported telephones:',
  'Liste der einzelnen Tastenfunktionen:' => 'List of available key functions',
  '-erben-' => '-inherit-',
  'Wenn "-erben-" aktiviert ist, wird die vom Administrator voreingestellte Funktion benutzt.' => 'If "-inherit" is activated, the function which is predefined by the administrator is used.',
  'Zielwahl' => 'Selected dialing',
  'Wenn Sie eine Zielwahl auf eine Rufnummer definiert haben, dann k&ouml;nnen Sie die Nummer durch einen Tastendruck anrufen.' => 'When a direct dial to a number is defined, you can dial this number by one keypress.',
  'Nebenstelle/BLF' => 'Extension/BLF',
  'Aktiviert die Besetztlampenfeldfunktion f&uuml;r eine bestimmte Nebenstelle. Mit der Besetztlampenfeldfunktion k&ouml;nnen Sie den Status der Nebenstelle sehen (Besetzt=Leuchten, Klingeln=Blinken). Desweiteren k&ouml;nnen Sie die Nebenstelle durch einen Druck auf diese Taste anrufen oder eine Ruf&uuml;bernahme durchf&uuml;hren, wenn Sie die Taste dr&uuml;cken w&auml;hrend die Besetztlampe blinkt.' => 'Activates the busy lamp field function for a specific extension. With the busy lamp field function you can watch the state of the extension (busy=lit, ringing=blink). Furthermore, you can call the extension by pressing the function key, or perform a call pickup by pressing the key while the busy lamp is blinking.',
  'Rufton aus' => 'Ringer off',
  'Schaltet den Rufton des Endger&auml;tes an oder aus. Wenn der Rufton aus ist, leuchtet die Lampe der Taste.' => 'Toggles the audible ringer of the terminal. When the ringer is disabled, the lamp of the key is lit.',
  'H&auml;lt das aktuell geführte Gespr&auml;ch. Der Anrufer h&ouml;rt Wartemusik.' => 'Puts the currently active call on hold. The caller gets music on hold.',
  'Makeln' => 'Alternate',
  'Mit dieser Funktion kann man zwischen Anrufern hin und her schalten, w&auml;hrend man sich in einer &Uuml;bergabe befindet.' => 'With this function you can switch between active calls while being in transferring state.',
  '&Uuml;bergabe' => 'Attended transfer',
  'Mit dieser Taste kann man eine Anruf&uuml;bergabe (mit R&uuml;ckfrage) einleiten.' => 'This key function initiates an attended transfer.',
  '&Uuml;berg. v. Melden' => 'Blind transfer',
  'Mit dieser Taste kann man eine Anruf&uuml;bergabe (ohne R&uuml;ckfrage) einleiten.' => 'This key function initiates a blind transfer.',
  'Weiterleiten' => 'Forward',
  'Mit dieser Funktion k&ouml;nnen Sie den Anrufer zu einem bestimmten Ziel weiterleiten.' => 'This key function forwards the caller to a specified destination.',
  'Shift' => 'Shift',
  'Mit der Shift-Funktion hat man die M&ouml;glichkeit, Tasten doppelt zu belegen. Die Funktion schaltet zwischen den Ebenen hin und her. Die eigentlichen Tastenfunktionen kann man dann in "Shift-Ebene" festlegen.' => 'The shift function enables double usage of keys. The function toggles between key levels. The key functions themselves can then be defined in "shift-level".',
  'Kopfh&ouml;rer' => 'Headset',
  'Mit dieser Taste k&ouml;nnen Sie das Gespr&auml;ch zwischen Kopfh&ouml;rer und Lautsprecher umschalten.' => 'This key function switches between headset and speaker mode.',
  'Nicht st&ouml;ren' => 'Do not disturb',
  'Sie k&ouml;nnen diese Funktion aktivieren, falls Sie z.B. im Kundengespr&auml;ch sind und nicht gest&ouml;rt werden wollen. Das Telefon wird dann nicht klingeln und auch nicht anzeigen, wenn es angerufen wird.' => 'You can activate this function if you\'re e.g. in a conversation and don\'t want to be disturbed. The phone will not ring and not show if it is being called.',
  'Rufanahmegrp.' => 'Pickup group',
  'Wenn Sie in einer Rufannahmegruppe sind, k&ouml;nnen Sie ein ankommendes Gespr&auml;ch mit dieser Taste aufnehmen.' => 'If you are in a pickup group, you can take an incoming call with this key.',
  'Kurzwahl' => 'Repertory dial',
  'Wenn Sie eine Kurzwahl auf eine Rufnummer definiert haben, dann k&ouml;nnen Sie die Nummer durch einen Tastendruck anrufen.' => 'A repertory dial to a destination enables you to call that destination with a key press.',
  'R&uuml;ckfrage' => 'Consultation',
  'Setzt den Anrufer auf "Halten" und ruft die Nummer, die bei Nummer/Daten eingegeben wurde, für eine R&uuml;ckfrage an.' => 'Puts the caller on "hold" and dials the number entered in Number/Data for consultation.',
  'Fn.Schalter' => 'Fn.trigger',
  'Mit dem Funktionsschalter kann man bestimmte Telefoniefunktionen aktivieren oder deaktivieren (z.B. die Rufumleitung). W&auml;hlen Sie einfach die gew&uuml;nschte Funktion aus dem Hilfe-Dialog aus. ' => 'The function trigger (de)activates specific telephony functions, like the call forward. Choose the desired function from the help dialog. ',
  'Appl. aufrufen' => 'App. exec.',
  'Erm&ouml;glicht das Belegen einer Applikation auf eine Taste, damit ist es m&ouml;glich, z.B. das Telefonbuch zu starten. W&auml;hlen Sie einfach die gew&uuml;nschte Applikation aus dem Hilfe-Dialog aus.' => 'Enables mapping of an application to a key. This makes it possible to open e.g. the phone book. Choose the desired function from the help dialog.',
  'Schritt 4:' => 'Step 4:',
  'Bei manchen Tastenfunktionen bietet das Programm eine Hilfestellung zum Ausf&uuml;llen der 3.Spalte \'Nummern/Daten\' an, wenn man - wie im Beispiel - \'Nebenstelle/BLF\' ausw&auml;hlt, dann kommt dieser Dialog:' => 'On some key functions the program offers help for filling the third column \'Number/Data\'. If as shown in the example \'Extension/BLF\' is chosen, it will show this dialog:',
  'In diesem Dialog k&ouml;nnen Sie die Nummer (1) die Sie im Besetztlampenfeld anzeigen wollen, eintragen und den Dialog mit dem Haken (2) best&auml;tigen.' => 'In this dialog the number (1), which is to be shown in the busy lamp field, can be entered, and the dialog be acknowledged with the check mark.',
  'Schritt 5:' => 'Step 5:',
  'Dannach sehen Sie, wie der Hilfedialog die Daten in Spalte 3 eingetragen hat. Sie m&uuml;ssen an diesem Text nichts mehr &auml;ndern. Sie k&ouml;nnen zus&auml;tzlich noch eine Beschriftung (1) eingeben, die die Taste am Telefon haben soll:' => 'After that, you can see how the helper dialog entered the data into the third column. You don\'t have to change the text anymore. You can optionally enter a description (1) which should show on the key on the phone:',
  'Schritt 6:' => 'Step 6:',
  'Sie können Schritt 3-5 f&uuml;r jede Taste, die Sie definieren wollen, wiederholen. Vergessen Sie aber nicht, am Ende auf \'Speichern und Telefon aktualisieren\' (1) zu klicken. Wenn Sie dies getan haben, sollte die &Auml;nderung ca. eine Minute sp&auml;ter auf Ihrem Telefon zu sehen sein.' => 'You can repeat steps 3-5 for every key you want to define. Don\'t forget to click on \'Save and update phone\' (1) when you\'re finished. After doing that, the change should show up on the phone after about one mintute.',
  'Ein-/Ausloggen am Telefon' => 'Login/logout at the phone',
  'Einloggen an einem Telefon. Dabei wird die Eingabe der PIN-Nummer verlangt.' => 'Login at a phone. Asks you to enter your PIN number.',
  'Ausloggen' => 'Logout',
  'Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot; auf die Std.-Nummer aktivieren. (Dazu m&uuml;ssen Sie im Men&uuml;punkt &quot;Rufumleitung&quot; eine Std.-Nr. angegeben haben!)' => 'Activate call forwarding for calls from internal and external in case &quot;always&quot; to the default number. (A default number needs to be set in menu &quot;Rufumleitung&quot;!)',
  'Tempor&auml;re Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot; auf die angegebene Nummer programmieren' => 'Program call forwarding for calls from internal and external in case &quot;always&quot; to the specified number',
  'Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot; auf den Anrufbeantworter aktivieren' => 'Program call forwarding for calls from internal and external in case &quot;always&quot; to the voice mail',
  'Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot; auf die Ansage ohne Anrufbeantworter aktivieren' => 'Program call forwarding for calls from internal and external in case &quot;always&quot; to the announcement without voice mail',
  'Rufumleitung f&uuml;r Anrufe von intern und extern im Fall &quot;immer&quot; deaktivieren' => 'Deactivate call forwarding for calls from internal and external in case &quot;always&quot;',
  'Anrufbeantworter abfragen' => 'Check Voicemail',
  'Eigenen Anrufbeantworter abfragen (Am Snom-Telefon kann daf&uuml;r auch die &quot;Retrieve&quot;-Taste gedr&uuml;ckt werden.)' => 'Check your own mailbox (Snom phone: Press &quot;Retrieve&quot; key.)',
  'Anderen Anrufbeantworter abfragen (mit PIN)' => 'Check other mailbox (requires PIN)',
  'Abwesenheitsansage aufzeichnen' => 'Record unavailable message',
  'Abwesenheitsansage f&uuml;r Anrufe von intern aufzeichnen' => 'Record unavailable message for calls from internal',
  'Abwesenheitsansage f&uuml;r Anrufe von extern aufzeichnen' => 'Record unavailable message for calls from external',
  'Privatgespr&auml;che' => 'Private calls',
  'Privatgespr&auml;ch f&uuml;hren' => 'Private call',
  'Einrichten eines Weckrufes' => 'Set up a wakeup call',
  'Einloggen in die Warteschlange mit der angegebenen Durchwahl' => 'Login to specified queue',
  'Ausloggen aus der Warteschlange mit der angegebenen Durchwahl' => 'Log out of specified queue',
  'Ausloggen aus allen Warteschlangen' => 'Log out of all queues',
  'Konferenzen' => 'Conferences',
  'Konf.nr.' => 'Conf.no.',
  'Einen Konferenzraum (nach 88 eine 3- oder 4-stellige Nummer) betreten bzw. er&ouml;ffnen. Wenn die Konferenz leer ist, kann eine PIN-Nr. gesetzt werden (f&uuml;r keine PIN # dr&uuml;cken). Ansonsten muss eine ggf. f&uuml;r diesen Raum gesetzte PIN eingegeben werden.' => 'Enter or open a conference room (88 plus 3 or 4 digit number). If the conference is empty you can optionally set a PIN number (press # for no PIN). Otherwise you need to enter the PIN set for this conference.',
  'oder' => 'or',
  'Einen freien Konferenzraum finden. Die Nummer der Konferenz wird beim Betreten angesagt. (Die anderen Teilnehmer w&auml;hlen dann <code>88 <i>Konferenznr.</i></code>, s.o.)' => 'Find a free conference room. Will read out the conference number on joining.',
  'Das SIP-Telefon Snom 360 bietet neben den &uuml;blichen Zifferntasten eine ganze Reihe n&uuml;tzlicher Funktionstasten, die bis zu einem gewissen Grad konfigurierbar sind. Die wichtigsten Tasten und Funktionen werden an dieser Stelle kurz aufgef&uuml;hrt. Eine genaue Beschreibung der Tasten finden Sie in dem &uuml;ber 100 Seiten starken Handbuch zu ihrem Snom-Telefon.' => 'Apart from the usual number block the SIP phone Snom 360 has some useful function keys. We&apos;ll give you are short introduction here. Please consult your Snom phone&apos;s manual for detailed instructions.',
  'Snom 360 Doku' => 'Snom 360 docs',
  'Snom 360 Tasten' => 'Snom 360 keys',
  '4 Softkeys unter dem Bildschirm' => '4 softkeys below display',
  'Diese Tasten werden mit kontextabh&auml;ngigen Funktionen belegt. Die Bedeutungen werden ggf. am unteren Rand des Displays angezeigt.' => 'These are context-sensitive softkeys. Their function will we shown at the bottom of the screen as necessary.',
  '<b>Lautst&auml;rke</b> des H&ouml;rers oder Lautsprechers -/+' => '<b>Volume</b> of handset or speaker -/+',
  '<b>Stummschaltung</b> des Mikrofons ein/aus' => '<b>Mute</b> or unmute the microphone',
  '<b>Lauth&ouml;ren</b> ein/aus' => '<b>Speaker</b> on/off',
  '<b>Abbrechen</b><br /> Gespr&auml;ch beenden, Gespr&auml;ch abweisen' => '<b>Cancel</b><br /> Hangup call, deflect call',
  'OK' => 'OK',
  '<b>Best&auml;tigen</b><br /> W&auml;hlen, Gespr&auml;ch annehmen' => '<b>Confirm</b><br /> Dial, answer call',
  '<b>Anrufbeantworter</b> abfragen<br /> Hat der Anrufbeantworter ein Gespr&auml;ch f&uuml;r Sie aufgezeichnet, wird dies durch Blinken der Message-LED signalisiert. Die Anzahl alter und neuer Nachrichten wird zus&auml;tzlich auch auf dem Display angezeigt.' => 'Check <b>Voicemail</b><br /> Once there are new messages on your mailbox the message LED will start blinking. Your display will show the numbers of new and old messages.',
  '<b>Wahlwiederholung</b><br /> Durch Dr&uuml;cken dieser Taste k&ouml;nnen Sie die letzten angerufenen Nummern erneut anrufen und sehen angenommene und verpasste Anrufe. W&auml;hlen Sie zun&auml;chst mit den Pfeiltasten die Nummer aus und dr&uuml;cken danach die OK-Taste.' => '<b>Redial</b><br /> By pressing redial you can redial the numbers of outgoing, answered and missed calls. Use the arrow keys to select a number then press OK.',
  '<b>Telefonbuch</b> (Firma / pers&ouml;nlich)<br /> z.B. 63437 f&uuml;r MEIER dr&uuml;cken (&auml;hnlich &quot;T9&quot;).' => '<b>Phonebook</b> (Company / private)<br /> enter 63437 for MEIER (similar to &quot;T9&quot;).',
  '<b>Vermitteln</b><br /> Es gibt zwei Wege, wie Sie Ihren Gespr&auml;chspartner mit einer anderen Nummer verbinden k&ouml;nnen:<br /> <i>Direktes Verbinden</i>: Wenn Sie w&auml;hrend eines Gespr&auml;chs die Transfer-Taste dr&uuml;cken, wird Ihr Gespr&auml;chsparter auf Halten gesetzt. Geben Sie danach die Nummer an, mit der Sie den Anrufer verbinden m&ouml;chten. Durch Dr&uuml;cken der OK-Taste wird der Teilnehmer dann mit der gew&auml;hlten Nummer verbunden.<br /> <i>Verbinden mit R&uuml;ckfrage</i>: Dr&uuml;cken Sie hierzu w&auml;hrend eines Gespr&auml;chs die Hold-Taste um Ihren Gespr&auml;chspartner zu halten und w&auml;hlen dann die Nummer, mit der Sie ihn verbinden m&ouml;chten. Sie k&ouml;nnen jetzt mit dem zweiten Teilnehmer sprechen. Durch Dr&uuml;cken der Transfer-Taste oder durch Auflegen werden die beiden Teilnehmer verbunden.' => '<b>Transfer</b><br /> There are two ways of transfering your callee to another phone number:<br /><i>Blind transfer</i>: If you press the Transfer-key during a call, your callee will be put on hold. After that, enter the destination number, where you want the callee being transferred to. By pressing the OK key, the callee will then be transferred.<br /><i>Attended transfer</i>: During an active call, press the Hold-key to put your callee on hold. After that, enter the destination number where you want the callee being transferred to. You can now speak to the destination party. By pressing the Transfer key or hanging up, both parties will be connected.',
  '<b>Halten</b> (R&uuml;ckfrage)<br /> Wenn Sie diese Taste w&auml;hrend eines Gespr&auml;chs dr&uuml;cken, wird Ihr Gespr&auml;chspartner auf Halten gesetzt. Danach k&ouml;nnen Sie eine weitere Verbindung zu einem anderen Teilnehmer herstellen. Mit den leuchtenden Leitungstasten k&ouml;nnen Sie zwischen beiden Leitungen hin- und herschalten (Makeln).' => '<b>Hold</b> (R)<br /> By pressing this key during an active call, the callee will be put on hold. After that you can establish another call to another extension or phone number. Using the lit line keys, you can switch between both called parties.',
  '<b>Nicht st&ouml;ren</b> ein/aus<br /> Wenn dieser Modus aktiviert ist, werden keine Anrufe zu Ihrem Telefon durchgestellt. Dabei wird auf dem Display links unten das Symbol und &quot;Inaktiv&quot; angezeigt. Auf Ihre ggf. eingestellte Rufweiterleitung wirkt dieser Modus, als w&auml;ren Sie gar nicht eingeloggt, also offline.' => '<b>Do Not Disturb</b> mode on/off<br /> When this feature is active, no calls will be delivered to your phone. The active state of this feature will be displayed on the phone display in the lower left corner by the corresponding symbol and the text &quot;Inactive&quot;. If you have call forwards configured, they work as if you are offline.',
  '<b>12 Leitungstasten</b><br /> Diese Tasten lassen sich mit Rufnummern programmieren.<br /> Im Men&uuml;punkt &quot;Tastenbelegung&quot; k&ouml;nnen Sie Ihre Einstellung ansehen und ver&auml;ndern.' => '<b>12 Line keys</b><br /> These keys are configurable with phone numbers.<br />In the &quot;Key configuration&quot; menu, you can check and modify your settings.',
