  'Suchen/Ersetzen-Muster (<a href="%s" target="_blank">PCRE</a>) f&uuml;r die Rufnummern&uuml;bermittlung bei abgehenden Anrufen. Beispiele:<br /> Nur die Durchwahl &uuml;bermitteln: <tt>s/^(.*)/$1/</tt><br /> Nationales Format: <tt>s/^(.*)/030123456$1/</tt><br /> Internationales Format: <tt>s/^(.*)/004930123456$1/</tt> oder <tt>s/^(.*)/+4930123456$1/</tt><br /> F&uuml;r alle Benutzer die gleiche Nummer &uuml;bertragen: <tt>s/^(.*)/00493012345612/</tt><br /> Normalerweise sollten Sie das nationale oder internationale Format verwenden.' => 'Search/replace pattern (<a href="%s" target="_blank">PCRE</a>) for Caller ID transmission on outbount calls. Examples:<br />Extension only: <tt>s/^(.*)/$1/</tt><br />National format: <tt>s/^(.*)/030123456$1/</tt><br />International format: <tt>s/^(.*)/004930123456$1</tt> or <tt>s/^(.*)/+4930123456$1</tt><br />Transmit same caller ID for all users: <tt>s/^(.*)/00493012345612/</tt><br />In most cases national or international format should be used.',
  'http://de.wikipedia.org/wiki/Regul%C3%A4rer_Ausdruck' => 'http://en.wikipedia.org/wiki/Regular_expression',
  'Geben Sie hier falls erforderlich ein <a href="%s" target="_blank">PCRE</a>-Muster an, das eventuelle Pr&auml;fixe von eingehend gew&auml;hlten Nummern wegschneidet, soda&szlig; nur noch die interne Durchwahl &uuml;brig bleibt! Beispiele:<br /> &nbsp;&nbsp;&nbsp; <tt>s/^026313370//</tt><br /> &nbsp;&nbsp;&nbsp; <tt>s/^(((0049|0)2631))3370//</tt><br /> &nbsp;&nbsp;&nbsp; <tt>s/^(?:(?:0049|0)2631)?3370(.*)/$1/</tt>' => 'If neccessary, enter a <a href="%s" target="_blank">PCRE</a> pattern that removes eventual prefixes from inbound numbers, so that only the internal extension remains! Examples:<br /> &nbsp;&nbsp;&nbsp; <tt>s/^026313370//</tt><br /> &nbsp;&nbsp;&nbsp; <tt>s/^(((0049|0)2631))3370//</tt><br /> &nbsp;&nbsp;&nbsp; <tt>s/^(?:(?:0049|0)2631)?3370(.*)/$1/</tt>',
  'Suchen/Ersetzen-Muster (<a href="%s" target="_blank">PCRE</a>) f&uuml;r die Rufnummern&uuml;bermittlung bei eingehenden Anrufen. Hiermit lassen sich Anrufernummern die vom Provider falsch &uuml;bermittelt werden korrigieren. Beispiel: <tt>s/^/0/</tt> oder <tt>s/^(.*)/0$1/</tt> um eine 0 an den Anfang zu setzen. Leer f&uuml;r keine Ersetzung.' => 'Search/replace pattern (<a href="%s" target="_blank">PCRE</a>) for Caller ID reception on inbound calls. This can be used to fix up numbers which are sent in a wrong format by a provider. Example: <tt>s/^/0/</tt> or <tt>s/^(.*)/0$1</tt> to add a 0 to the beginning. Empty for no replacements.',
  'Experimentell' => 'Experimental',
  'Sie k&ouml;nnen diese Feld auch verwenden um f&uuml;r die Anruflisten mit <tt>s/^/0/</tt> oder <tt>s/^(.*)/0$1/</tt> eine 0 am Anfang hinzuzuf&uuml;gen oder mit <tt>s/^0//</tt> oder <tt>s/^0(.*)/$1/</tt> eine 0 am Anfang wegzuschneiden.' => 'You can also use this option to add a 0 to all numbers in the call logs with <tt>s/^0/</tt> or <tt>s/^(.*)/0$1/</tt>, or remove a leading 0 with <tt>s/^0//</tt> or <tt>s/^0(.*)/$1</tt>.',
  'Tragen Sie pro Zeile eine interne Caller-ID (Nebenstellennummer) ein, die Sie beim W&auml;hlen &uuml;ber diese Gateway-Gruppe zu einer externen Caller-ID (Durchwahlnummer) umsetzen m&ouml;chten, z.B. um pro Benutzer eine abgehende <a href="%s" target="_blank">MSN</a> festzulegen.' => 'Enter one Caller ID (extension) per line that should be mapped to an external caller ID when dialing via this gateway group, to set up an outbound <a href="%s" target="_blank">MSN</a> per user.',
